import React from 'react';
import './Node.css'
export default class Node extends React.Component {
  constructor(props) {
    super(props);
    this.key = props.key;
    this.children = [];
  }
  render() {
    const extraClassName = this.props.isFinish ? 'node-finish' : this.props.isStart ? 'node-start' : '';
    return <div className={`node ${extraClassName}`}></div>
  }
}
